import React from 'react';
import Modal from '../../Modal/Modal';
import Notes from './Notes';

export default function AddNotes({ onClose }) {
  return (
    <Modal>
      <h3 style={{ textAlign: 'center', marginBottom: '1rem' }}>Add New Note</h3>
      <Notes onClose={onClose} />
    </Modal>
  );
}
